class Double
{
public:
    Double(const cubareal& x)
        : m_x(x)
    {

    }

    /*operator const double () const
    {
        return m_x;
    }*/

    Double operator*(const double& y)
    {
         return Double(m_x*y);
    }

    Double operator*(const Double& y)
    {
         return Double(m_x*y.m_x);
    }
    Double operator+(const double& y)
    {
         return Double(m_x+y);
    }

    Double operator+(const Double& y)
    {
         return Double(m_x+y.m_x);
    }

    Double operator-(const double& y)
    {
         return Double(m_x-y);
    }
    Double operator-(const Double& y)
    {
         return Double(m_x-y.m_x);
    }
    Double operator/(const double& y)
    {
         return Double(m_x/y);
    }
    Double operator/(const Double& y)
    {
         return Double(m_x/y.m_x);
    }

    Double operator^(const double& y)
    {
        return Double(pow(m_x, y));
    }


    Double operator^(const Double& y)
    {
        return Double(pow(m_x,y.m_x));
    }

    cubareal m_x;
};

Double operator+(const Double& y)
{
    return Double(+y.m_x);
}

Double operator-(const Double& y)
{
    return Double(-y.m_x);
}

Double operator+(const double& x, const Double& y)
{
    return Double(double(x)+y.m_x);
}

Double operator-(const double& x, const Double& y)
{
    return Double(double(x)-y.m_x);
}

Double operator*(const double& x, const Double& y)
{
    return Double(double(x)*y.m_x);
}

Double operator/(const double& x, const Double& y)
{
    return Double(double(x)/y.m_x);
}

Double operator^(const double& x, const Double& y)
{
    return Double(pow(x,y.m_x));
}

Double operator+(const int& x, const Double& y)
{
    return Double(double(x)+y.m_x);
}

Double operator-(const int& x, const Double& y)
{
    return Double(double(x)-y.m_x);
}

Double operator*(const int& x, const Double& y)
{
    return Double(double(x)*y.m_x);
}

Double operator/(const int& x, const Double& y)
{
    return Double(double(x)/y.m_x);
}

Double operator^(const int& x, const Double& y)
{
    return Double(pow(double(x),y.m_x));
}

Double sqrt(const Double& x)
{
    return Double(sqrt(x.m_x));
}

static inline Double Sq(cubareal x) {
  return Double(x*x);
}

static inline Double Cb(cubareal x) {
  return Double(x*x*x);
}

static inline Double Qu(cubareal x) {
  return Double(x*x*x*x);
}

static inline Double Fi(cubareal x) {
  return Double(x*x*x*x*x);
}

static inline Double Si(cubareal x) {
  return Double(x*x*x*x*x*x);
}

static inline Double Se(cubareal x) {
  return Double(x*x*x*x*x*x*x);
}

static inline Double Ei(cubareal x) {
  return Double(x*x*x*x*x*x*x*x);
}

//z - координаты заряда и точки наблюдения
static inline cubareal zq (cubareal rq, cubareal theta_q)
{
    return (rq)*cos(theta_q);
}
static inline cubareal za (cubareal ra, cubareal theta_a)
{
    return (ra)*cos(theta_a);
}

// введём вспомогательные переменные - цилиндрический радиус
// как координата r точки при переходе в цилиндрическую систему коорденат с тем же направлением оси z
static inline cubareal rcq (cubareal rq, cubareal theta_q )
{
    return (rq)*sin(theta_q);
}
static inline cubareal rca (cubareal ra, cubareal theta_a )
{
    return (ra)*sin(theta_a);
}

// выражение для расстояния между точкой заряда и точкой наблюдения примет вид
static inline cubareal R0 (cubareal ra, cubareal theta_a, cubareal rq, cubareal theta_q, cubareal phi_q)
{
    return sqrt(Sq(rca(ra, theta_a)) + Sq(rcq(rq, theta_q)) + Sq(za(ra, theta_a)-zq(rq, theta_q)) - 2*rca(ra, theta_a)*rcq(rq, theta_q)*cos(phi_q)).m_x;
}

static inline cubareal R_a (cubareal ra, cubareal theta_a, cubareal rq, cubareal theta_q, cubareal phi_q, cubareal c, cubareal a)
{
    cubareal R_0 = R0 (ra, theta_a, rq, theta_q, phi_q);
    cubareal dz = za(ra, theta_a) - zq(rq, theta_q);
    return c/a*sqrt(2*Sq(c) - 2*a*dz - 2*sqrt(-Sq(R_0*a) + Qu(c) - 2*a*Sq(c)*dz + Sq(a*dz) ) ).m_x;
}






